import React from 'react';
import MediaQuery from 'react-responsive';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import { Link } from 'react-router-dom';
import { Toolbar, Container, Box, Typography, IconButton } from '@material-ui/core';
import theme from '../theme/theme';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import { Mail, LinkedIn, GitHub } from '@material-ui/icons';


const useStyles = makeStyles((theme) => ({
    footerNav: {
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'center',
        marginBottom: theme.spacing(1)
      },
      footerLink: {
        marginLeft: theme.spacing(3),
        marginRight: theme.spacing(3),
        marginBottom: theme.spacing(2),
      }
}));

export default function App() {

    const classes = useStyles();

    return (
        <div>
            <footer>
            <Container maxWidth="lg">
                <Box py={6} textAlign="center">
                <Box component="nav" className={classes.footerNav}>
                    <Link href="http://google.com" variant="body1" color="textSecondary" className={classes.footerLink}>Features</Link>
                    <Link href="#" variant="body1" color="textSecondary" className={classes.footerLink}>Enterprise</Link>
                    <Link href="#" variant="body1" color="textSecondary" className={classes.footerLink}>Support</Link>
                    <Link href="#" variant="body1" color="textSecondary" className={classes.footerLink}>ICO</Link>
                </Box>
                <Box mb={3}>
                    <IconButton color="textSecondary" aria-label="Instagram">
                    <Mail />
                    </IconButton>
                    <IconButton color="textSecondary" aria-label="LinkedIn">
                    <LinkedIn />
                    </IconButton>
                    <IconButton color="textSecondary" aria-label="GitHub">
                    <GitHub />
                    </IconButton>
                </Box>
                <Typography color="textSecondary" component="p" variant="body2" gutterBottom={false} className={classes.copy}>Â© 2020 Pied Piper. All rights reserved.</Typography>
                </Box>
            </Container>
            </footer>
        </div>
    )
}
